const wikiParser = (data) => {
  const resultArray = [];
  let newObj = {};
  function e(test){
    if (test === undefined){
      return 'N/A';
    }
    else {
      return test;
    }
  }
  function d(test){
    if (test === undefined){
      return 'N/A';
    }
    else {
      return test['fulltext'];
    }
  }
  for (const key in data){
    newObj.Name = e(data[key]['printouts']['English name'][0])
    newObj.CardType = d(data[key]['printouts']['Card type'][0])
    newObj.MonsterType = d(data[key]['printouts']['Monster type'][0])
    newObj.Type = d(data[key]['printouts']['Type'][0])
    newObj.Attribute = d(data[key]['printouts']['Attribute'][0])
    newObj.Property = e(data[key]['printouts']['Property'][0])
    newObj.Level = e(data[key]['printouts']['Level'][0])
    newObj.ATK = e(data[key]['printouts']['ATK'][0])
    newObj.DEF = e(data[key]['printouts']['DEF'][0])
    newObj.Lore = e(data[key]['printouts']['Lore'][0])
      
    const setsArr = [];
    if (data[key]['printouts']['-Set contains'][0] === undefined){
      setsArr[0] = 'None'
    } 
    else {
      data[key]['printouts']['-Set contains'].forEach((element) => {setsArr.push(element['displaytitle'])})
    }
    newObj.Sets = setsArr
      
    const decksArr = [];
    if (data[key]['printouts']['-Deck contains'][0] === undefined){
      decksArr[0] = 'None'
    }
    else {
      data[key]['printouts']['-Deck contains'].forEach((element) => {decksArr.push(element['fulltext'].split('#')[0])});
    }
    newObj.Decks = decksArr;
      
    newObj.ImageName = data[key]['printouts']['Card image'][0];
    resultArray.push(newObj);
    newObj = {};
  }
  return resultArray;
};

const parsedData = wikiParser(data);

fs.writeFileSync('./gameData.json', parsedData)
